export const Signin = () => {
    return (
    <form>
        <label for="email">Email: </label>
        <input type="email" placeholder="example@gmail.com" />
        <label for="password">Password: </label>
        <input type="password" placeholder="**********" />
        <button>Log In!</button>
    </form>
    )
}
